import React, { useEffect, useState } from 'react';
import { createClient } from '@supabase/supabase-js';

// Използвайте вашия коригиран URL
const supabaseUrl = 'https://lnquyopfvuikhjbjsiqk.supabase.co';
const supabaseKey = 'eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpc3MiOiJzdXBhYmFzZSIsInJlZiI6ImxucXV5b3BmdnVpa2hqYmpzaXFrIiwicm9sZSI6ImFub24iLCJpYXQiOjE3NDU0ODA5MDEsImV4cCI6MjA2MTA1NjkwMX0.GmZ-5FzZkJyMorLGggF_Jegx2Atn0wRiNKCx4esecJw'; // Уверете се, че това е правилният ключ
const supabase = createClient(supabaseUrl, supabaseKey);

function Home() {
  const [restaurants, setRestaurants] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [rawData, setRawData] = useState(null); // За съхраняване на необработените данни за отстраняване на грешки

  useEffect(() => {
    async function fetchRestaurants() {
      try {
        console.log("Започваме зареждане на ресторанти");
        
        const response = await supabase.from('restaurants').select('*');
        
        console.log("Пълен отговор от Supabase:", response);
        setRawData(response);
        
        if (response.error) {
          console.error("Supabase грешка:", response.error);
          setError(response.error.message);
        } else {
          console.log("Получени данни:", response.data);
          setRestaurants(response.data || []);
        }
      } catch (error) {
        console.error('Грешка при зареждане на ресторанти:', error.message);
        setError(error.message);
      } finally {
        setLoading(false);
      }
    }
    
    fetchRestaurants();
  }, []);

  return (
    <div className="home-container">
      <h2>Нашите ресторанти</h2>
      
      {/* Секция за отстраняване на грешки */}
      <div style={{background: '#f8f9fa', padding: '15px', margin: '15px 0', borderRadius: '5px', border: '1px solid #ddd'}}>
        <h3>Диагностична информация:</h3>
        <p><strong>Състояние на зареждане:</strong> {loading ? 'Зареждане...' : 'Завършено'}</p>
        <p><strong>Брой ресторанти:</strong> {restaurants ? restaurants.length : 0}</p>
        <p><strong>Грешка:</strong> {error || 'Няма'}</p>
        
        <div>
          <h4>Получени данни от Supabase:</h4>
          <pre style={{background: '#eee', padding: '10px', borderRadius: '5px', overflow: 'auto', maxHeight: '200px'}}>
            {rawData ? JSON.stringify(rawData, null, 2) : 'Няма данни'}
          </pre>
        </div>
      </div>
      
      {error && (
        <div style={{color: 'white', padding: '15px', background: '#dc3545', borderRadius: '5px', marginBottom: '20px'}}>
          <strong>Грешка:</strong> {error}
        </div>
      )}
      
      {loading ? (
        <div style={{padding: '20px', textAlign: 'center', background: '#f8f9fa', borderRadius: '5px'}}>
          Зареждане на ресторанти...
        </div>
      ) : (
        <div className="restaurants-list">
          {restaurants.length === 0 ? (
            <div style={{padding: '20px', textAlign: 'center', background: '#f8f9fa', borderRadius: '5px'}}>
              <p>Няма намерени ресторанти. Моля, добавете някои в Supabase.</p>
            </div>
          ) : (
            restaurants.map(restaurant => (
              <div key={restaurant.id} className="restaurant-card">
                <h3>{restaurant.name || 'Без име'}</h3>
                <p>{restaurant.address || 'Няма адрес'}</p>
                <p>{restaurant.phone || 'Няма телефон'}</p>
              </div>
            ))
          )}
        </div>
      )}
    </div>
  );
}

export default Home;
